import React from 'react';
import Navbar from "./components/shared/Navbar";
import Sidebar from "./components/shared/Sidebar";

function Dashboard() {
    return (
        <div>
            <div>
                <Navbar></Navbar>
                <div style={{ display: 'flex' }}>
                    <Sidebar></Sidebar>

                </div>

            </div>
        </div>
    )
}

export default Dashboard
